INSERT INTO `setting` VALUES (1,'10:00:00','17:00:00',4,'<p class=\"ql-align-right ql-direction-rtl\">جهت واریز به شماره حساب ...</p>','مهمانان گرامی و عزیز به شهر استانبول خوش آمدید \nلطفا موارد زیر را رعایت فرموده و همکاری لازم را به عمل آورید:\n- ساعت ورود (تحویل اتاق) ساعت 14:00 و ساعت خروج (تحویل اتاق) ساعت 12:00 می باشد.\nصبحانه رایگان و هزینه ی مینی بار و خدمات جانبی هتل در صورت استفاده، جداگانه از سمت هتل با شما حساب می شود.\n- لیدر های شرکت مسئول سرویس دهی به شما میهمانان گرامی میباشند ولی در صورت شرکت در تور های متفرقه دیگر، شرکت هیچ گونه مسئولیتی در قبال اتفاقات احتمالی را بر عهده نمی گیرد.\n- به علت شلوغی و ترافیک شهری ، امکان تاخیر 15 تا 25 دقیقه ای از طرف شرکت وجود دارد،\nحق تغییر و کنسلی تورها از طرف شرکت محفوظ میباشد.\n- ساعت ترانسفر برگشت فرودگاهی خود را یک روز قبل با لیدر خود هماهنگ کنید.\n- در کلیه ی ترانسفر ها بار مجاز مسافر یک چمدان 30 کیلو و یک کوله پشتی 10 کیلو می باشد.','Liqo Trip','00905061591953','00905497115912','City Tour With Lunch','POUYAN','02122382020','02122382012','reservation@liqotrip.com');
/*!40000 ALTER TABLE `setting` ENABLE KEYS */;
UNLOCK TABLES;

